import React, { Component } from 'react';
import './Profil.css'

class MyProfil extends Component {
    render () {
        return (
            <div className="PageProfil" style={{height: '100vh'}}>
                <div classname="">
                    <ul className="">
                        <li style={{width:'200px',  height:'50px', display:'flex', justifyContent:'center', alignItems:'center', backgroundColor:'blue'}}>Mes informations</li>
                        <li style={{width:'200px', height:'50px', textAlign:'center', backgroundColor:'blue'}}>Mes commandes</li>
                        <li style={{width:'200px', height:'50px', textAlign:'center', backgroundColor:'blue'}}>Ma Liste</li>
                    </ul>
                </div>
            </div>
        );
    };
};

export default MyProfil;
